import EdificioCrudCard from 'components/EdificioCrudCard';
import { Link } from 'react-router-dom';

import './styles.css';

const List = () => {
  const edificio = {
    id: 1,
    localizacao: 'Aveiro',
    tipologia: 'Prédio',
    nome: 'Edificio do Sol',
    utilizacao: 'Habitação',
    arquitetura: 'Moderna',
    piso: 3,
    fracao: '2A',
    imgUrl:
      'https://www.ferreiralapa.com/wp-content/uploads/2021/09/3-1-1024x768.jpg',
    date: '2022-04-14T10:00:00Z',
    createdAt: '2023-01-02T15:12:18.921225Z',
    anomalias: [
      {
        id: 2,
        consequente: 'Não',
        inconsequente: 'Sim',
        date: '2022-04-14T10:00:00Z',
        descricao: 'Não causou patologias',
        edificios: [],
      },
    ],
  };

  /**
   * No Link abaixo (do botão adicionar/criar, vamos diferenciar entre a rota para criar e para editar)
   */
  return (
    <div>
      <Link to="/admin/edificios/create">
        <button className="btn btn-primary text-white btn-crud-add">
          ADICIONAR / CRIAR
        </button>
      </Link>
      <div className="base-card edificio-filter-container">Search bar</div>
      <EdificioCrudCard edificio={edificio} />
      <EdificioCrudCard edificio={edificio} />
      <EdificioCrudCard edificio={edificio} />
    </div>
  );
};

export default List;
